// MainContent.js
import React from "react";
import "./MainContent.css";

const MainContent = () => {
  return (
    <div className="main-content">
      <h1>Welcome to LoopzCoder</h1>
      <p>Explore our amazing projects and resources!</p>
    </div>
  );
};

export default MainContent;
